import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";
import "./index.css";
import App from "./App";
import {AuthProvider} from 'react-auth-kit';

ReactDOM.render(
	<React.StrictMode>
		<AuthProvider
			authType={"cookie"}
			authName={"_auth"}
			cookieDomain={"http://localhost:3001"}
			cookieSecure={false}
			>
			<BrowserRouter>
				<App />
			</BrowserRouter>
		</AuthProvider>

	</React.StrictMode>,
	document.getElementById("root")
);
